import React from 'react';
import { Consumer } from './Context';

const Gif = props => (
  <Consumer>
  { context => {
    console.log(context)
    return (
      <li className="gif-wrap" title={context.gif.title}>
        <a href={context.gif.bitly_url} target="_blank" rel="noopener noreferrer">
          <img src={context.gif.images.fixed_height.url} alt={context.gif.title} />
        </a>
      </li>
    )
  }}
  </Consumer>


);

export default Gif;
